import React, { useState } from "react";
import { Container, Grid } from "@material-ui/core";
import Content from "./Content";
import Button from "../../Button";
import styled from "styled-components";

function OurWorks() {
    const [featured] = useState([
        {
            title: "KEMIS YELEBESKU LET",
            image: "assets/kemis-yelebesku.png",
            type: "Feature Film",
            description: "Video production work with"
        },
        {
            title: "TEDDY AFRO - MAR ESKE TUAF",
            image: "assets/teddy-afro.png",
            type: "Music Video",
            description: "Video production work with"
        },
        {
            title: "EWUR AMORA KELABI",
            image: "assets/ewuramora.png",
            type: "Documentary",
            description: "Video production work with"
        },
        {
            title: "JAON BEER",
            image: "assets/jano.png",
            type: "Advertising",
            description: "Video production work with"
        },
    ]);

    return (
        <Container>


            {featured.map((f, key) => (
                <SectionWrapper>
                    <Grid container spacing={8}>
                        <Content {...f} />
                    </Grid>
                </SectionWrapper>
            ))}
            <Button>View More</Button>
        </Container>
    );
}

export default OurWorks;

const SectionWrapper = styled.section`
  display: flex;
  flex-direction: row;
  gap: 20px;
  padding: 16px;
`;
